import React from 'react'

import './card.css'

function Card(props)
{

    return( 
        <div className="card box" >
 
        <img src="https://images.unsplash.com/photo-1665466142333-e5c3369c4530?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHwxMnx8fGVufDB8fHx8&auto=format&fit=crop&w=600&q=60" className="card-img-top imgbox" alt="..."/>
        <div className="card-body">
          <h5 className="card-title">{args.title}</h5>
          <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.
         
          demonstrate the visual form of a document or a typeface without relying on meaningful content. Lorem ipsum may be used as a placeholder before final copy is available.
          </p>
          <a href="/" className="btn btn-primary">Go somewhere</a>
        </div>
      </div>
      
      
          
    );
}

export default Card;
